    false,nt"url": null,nt"notes": "The National Wildlife Refuge System conducted
    487 mammal trapping programs on 281 National Wildlife Refuges during the five-year
    period between 1992 and 1996. This report demonstrates the importance of trapping
    as a professional wildlife management tool. Mammal trapping also provided important
    benefits for public health and safety and recreational, commercial, and subsistence
    opportunities for the public during the period.This report provides an overview
    of mammal trapping activities that occurred within the National Wildlife Refuge
    System (System) between the years of 1992 to 1996. Information presented in the
    report should be considered preliminary. A complete validation of data presented
    has not been completed.",nt"license_title": "License Not Specified",nt"extras":
